import React from 'react';

function Jumbotron() {
    return (
    <div className='jumbotron jumbotron-fluid bg-secondary text-white'>
        <span className='display-2'>
            Google Book Search
        </span>
        <span className='lead'>
            Find and save your favorite books
        </span>
    </div>
    )
}

export default Jumbotron;
